import Button from "react-bootstrap/Button";
import { Container } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";
import Alert from "react-bootstrap/Alert";

import "bootstrap/dist/css/bootstrap.min.css";

function VictimReqMain() {
  const styles = {
    cardImg: {
      width: "15vw",
      height: "12vw",
      padding: "10px",
    },
  };
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5">
        <Card style={{ width: "30rem" }} classNam="mt-5">
          <Alert>
            <Alert.Heading className="d-flex justify-content-center">
              SEND RESCUE & RELIEF REQUEST
            </Alert.Heading>
            <div className="d-flex justify-content-end pt-3">
              Victim Id:1212
            </div>
          </Alert>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/rescue.png")}
              />
            </Col>
            <Col sm={6}>
              <div>
                <Button className="mt-5">Rescue Request</Button>
              </div>
            </Col>
          </Row><HR></HR>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/medical.png")}
              />
            </Col>
            <Col sm={6}>
              {" "}
              <Button className="mt-5">Food & Medical Request</Button>
            </Col>
          </Row>
          <Row>
            <Col sm={6}>
              <Card.Img
                style={styles.cardImg}
                src={require("../../images/shelter.png")}
              />
            </Col>
            <Col sm={6}>
              {" "}
              <Button className="mt-5">Shelter Request</Button>
            </Col>
          </Row>
        </Card>
      </div>
    </>
  );
}

export default VictimReqMain;
